const Search = () => {
    return(
        <>
            <div className="box_center" style={{ marginTop:"50px" }}>
                <input 
                    type="text" 
                    placeholder="Search anything" 
                    style={{marginRight:"20px"}}
                    
                />
                <button className="button">Search</button>
            </div>
        </>
    );
};
export default Search;
